intermediateGames.describe:
幻兽的夕濉和夜濉都吃百分比。
对于夜濉来说,魔法系崩坏可破防,不用太留意;
但是夕濉破防就比较麻烦了,所以一般带个百分比比较好打,如果没有百分比坐骑可以用空手的赤练

festivalGames.describe:
队长有入场券,进入押金任务
除了队长以外的队员都直接退出游戏,等队长过了第一个入场检测后在上线。
走法一般为:下-下-下(南瓜女巫)-上-右右(狂暴精灵王/幼年精灵王/千年魔牛)-上(古龙)-右-下(狂暴精灵王/幼年精灵王/巨石);
一局最多遇到两个任务BOSS,魔牛和巨石不可能同时出现;
在十连开启时狂暴精灵王可以掉落无限潜能套装(包括三族的精灵王)

